import React from 'react'
import ob from './Text.module.css'

const Text = () => {
    return (
        <div>
            <ul className={ob.ul}>
                    <li><a className={ob.item} href="#">Парковка</a></li>
                    <li><a className={ob.item} href="#">Страховка</a></li>
                    <li><a className={ob.item} href="#">Бензин</a></li>
                    <li><a className={ob.item} href="#">Обслуживание</a></li>
                </ul>
        </div>
    )
}


export default Text;
